import React from 'react';

import CollectionsOverview from '../../components/collections/CollectionsOverview';
const Shop = ({ collections }) => {
  return (
    <div>
      {collections.map(({ id, ...otherProps }) => (
        <CollectionsOverview />
      ))}
    </div>
  );
};

export default Shop;
